from pprint import pprint

class Solution(object):
    def findTheDifference(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: str
        """
        
        chars = {}

        for c in s:
            if c not in chars:
                chars[c] = 1
            else: 
                chars[c] += 1

        # pprint(chars)

        for c in t:
            if c not in chars:
                chars[c] = 1
            else:
                chars[c] -= 1

        # pprint(chars)

        for i in chars:
            if chars[i] != 0:
                return i


s = ""

t = ""

soln = Solution()
print(soln.findTheDifference(s, t))
